import React from 'react';
import { Tabs, Tab, Box, Card, CardContent, CardMedia, Typography, Stack } from '@mui/material';

const EventsDiscovery = () => {
    const [value, setValue] = React.useState(0);

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };

    return (
        <>
            <Typography variant='h1' style={{ fontFamily: 'Montserrat, sans-serif', fontWeight: 'bold', color: 'white', fontSize: '50px', textAlign: 'center', marginTop: '8px', marginBottom: '4px' }}>
                Events
            </Typography>
            <Box style={{ backgroundColor: '#9c27b0', borderRadius: '10px', padding: '10px', marginBottom: '20px' }}>
                <Tabs value={value} onChange={handleChange} variant='standard'>
                    <Tab label='Dance' style={{ fontSize: '20px', color: 'white', marginRight: '10px', '&:hover': { backgroundColor: '#7b1fa2' }, '&.Mui-selected': { backgroundColor: '#7b1fa2' } }} />
                    <Tab label='Music - Classical' style={{ fontSize: '20px', color: 'white', '&:hover': { backgroundColor: '#7b1fa2' }, '&.Mui-selected': { backgroundColor: '#7b1fa2' } }} />
                </Tabs>
            </Box>
            <Box>
                <Stack spacing='20px' style={{ marginTop: '20px', marginBottom: '20px' }}>
                    <Card style={{ display: 'flex', flexDirection: 'row', overflow: 'hidden', variant: 'elevated', backgroundColor: 'rgba(255, 255, 255, 0.8)', maxWidth: '97%', padding: '20px', borderRadius: '50px' }}>
                        <CardMedia
                            component='img'
                            image='/p5.png'
                            style={{ flex: '0 0 auto', width: '70%', maxWidth: '50%', objectFit: 'cover' }}
                            alt='Logo of Brand'
                        />
                        <CardContent style={{ flex: '1 1 auto', padding: '10px' }}>
                            <Typography variant='h4' style={{ fontFamily: 'Montserrat, sans-serif', fontWeight: 'bold' }}>
                                Event 1
                            </Typography>
                            <Typography variant='body1' style={{ fontSize: '18px', fontFamily: 'Montserrat, sans-serif', fontWeight: '500' }}>
                                Our primary goal is to create an app to empower individuals within the arts and performance community...
                            </Typography>
                        </CardContent>
                    </Card>
                    {/* Repeat Card structure for other events */}
                </Stack>
            </Box>
        </>
    );
}

export default EventsDiscovery;
